            WriteLiteral(@"
                </div>
                <div class=""about-right col-8"">
                    <h4>Bizim Şüşə Rəfləri Haqqında</h4>
                    <br>
                    <p>Şüşə rəflər, bankı pozmadan məkanınıza yüksək dizayn əlavə etmək üçün əla bir yoldur. Xüsusi şüşə rəflərin tam seçimi və anbarda olan şüşə və rəf dəsti seçimlərimiz var. Şüşə rəflərimiz haqqında bilməli olduğunuz bəzi şeylər bunlardır.</p>
                    <br>
                    <ul>
                        <li>
                            <p>Xüsusi şüşə rəflər düzbucaqlı və ya kvadrat formalarda mövcuddur və siz rəf mötərizələrini ayrıca sifariş etməlisiniz. Rəflərinizdə şüşənin qalınlığını, şüşənin rəngini və ya kənar bitirmə növünü təyin etmək lazım olduqda, xüsusi şüşə rəf seçin.</p>
                        </li>
                        <li>
                            <p>Künc şüşə rəflərimiz stokda olan ölçülərdə mövcuddur və siz avadanlığı ayrıca satın almalı olacaqsınız.</p>
                        </li>
     ");
            WriteLiteral(@"                   <li>
                            <p>Bizim ehtiyatda olan şüşə rəflərimizin əksəriyyəti əvvəlcədən hazırlanmış ölçülərdədir və lazımi şüşə rəf aparatlarını ehtiva edir.</p>
                        </li>
                    </ul>
                </div>
            </div>
        </div>
    </section>

    <section id=""where-use"">
        <div class=""container"">
            <div class=""row"">
                <div class=""where-use-right col-8"">
                    <h4>Şüşə Rəfləri Harada İstifadə Etmək Olar</h4>
                    <br>
                    <p>Xüsusi və əvvəlcədən hazırlanmış şüşə rəflərimiz evinizin və ya iş yerinizin müxtəlif yerlərində istifadə edilə bilər. Onlar digər rəflər kimi möhkəmdirlər və kifayət qədər çəki saxlaya bilirlər. Divara quraşdırılmış şüşə rəf işığı artıran, sadələşdirilmiş görünüş üçün lazımi miqdarda müasir sinif əlavə edə bilər. Burada şüşə rəflərdən istifadə edə biləcəyiniz bəzi yerlər var.</p>
                    <br>
                  ");
            WriteLiteral(@"  <ul>
                        <li>
                            <p>Vanna otaqları - bizim xüsusi rəflərimiz və rəf dəstlərimiz vanna otağı kimi rütubətli mühitdə, hətta duşda belə istifadə üçün təhlükəsizdir!</p>
                        </li>
                        <li>
                            <p>Mətbəxlər - sınıq şkaf rəfini əvəz etmək və ya cəlbedici saxlama yeri əlavə etmək üçün şüşə rəflərdən istifadə edin.</p>
                        </li>
                        <li>
                            <p>Ev dekorasiyası - oturma otağında, yataq otağında, şkafda və ya yeməkxanada şüşə rəflərdən istifadə edin.</p>
                        </li>
                        <li>
                            <p>Ofislər - xüsusi şüşə rəflər, istər evinizdə, istərsə də biznesinizdə müasir iş sahəsi yarada bilər.</p>
                        </li>
                        <li>
                            <p>Restoranlar və Barlar - Xüsusi şüşə rəflər biznesiniz, xüsusən də bar və restoranlar üçün əla seçimdi");
            WriteLiteral("r. Təmiz saxlamaq asandır və ağır istifadə üçün kifayət qədər davamlıdırlar.</p>\r\n                        </li>\r\n                    </ul>\r\n                </div>\r\n                <div class=\"where-use-left col-4\">\r\n                    ");
