    <section id=""how-use"">
        <div class=""container"">
            <h3>Şüşə rəfləri necə sifariş etmək olar</h3>
            <br>
            <p>Məkanınız üçün düzgün şüşə rəf aldığınızdan əmin olun! Hər hansı bir sualınız varsa, kömək etmək üçün buradayıq. Şüşə rəflər sifariş etmək üçün addımlar bunlardır:</p>
            <br>
            <ol>
                <li>
                    <p>Rəflərinizi asmaq istədiyiniz sahəni ölçün.</p>
                </li>
                <li>
                    <p>Nə qədər mötərizə lazım olacağını hesablayın. Çəki Yükü kalkulyatoru seçdiyiniz şüşənin qalınlığına əsasən mötərizələrinizi bir-birindən nə qədər məsafədə yerləşdirmək istəyə biləcəyiniz haqqında bəzi məlumatları ehtiva edir.</p>
                </li>
            </ol>
            <br>
            <p>Unutmayın ki, şüşə rəfləriniz üçün heç bir xüsusi tələbiniz yoxdursa, siz həmişə bir şüşə rəf dəsti sifariş edə bilərs");
            WriteLiteral(@"iniz.</p>
        </div>
    </section>

    <section id=""brackets"">
        <div class=""container"">
            <div class=""row"">
                <div class=""brackets-left col-8"">
                    <h3>Şüşə Rəf Tutacaqları</h3>
                    <br>
                    <p>Fərdi şüşə rəf sifariş edirsinizsə, rəf mötərizələrini ayrıca sifariş etməlisiniz. Bilməli olduğunuz şey budur:</p>
                    <br>
                    <ul>
                        <li>
                            <p>Mötərizələrimiz davamlı, yüksək keyfiyyətli paslanmayan poladdan hazırlanır.</p>
                        </li>
                        <li>
                            <p>Hər bir paket iki mötərizə, iki drywall anker və iki vint ilə gəlir.</p>
                        </li>
                        <li>
